import react from "react";
import { useState } from "react";
import { useNavigate } from "react-router-dom";
import './teams.css'

function Team({ team1, matches, wins, loses, draws }) {

}

export default function TeamsPage({ isAdmin }) {
    const navigate = useNavigate();
    function handleClickTeams() {
        navigate('/teams')
    }
    function handleClickMatches() {
        navigate('/matches')
    }
    function handleClickTables() {
        navigate('/tables')
    }

    function handleLogout() {
        sessionStorage.removeItem("accessToken");
        sessionStorage.removeItem("refreshToken");
        localStorage.removeItem("isAdmin");
        navigate('/login');
    }

    return (
        <>
            <div className="content-teams">
                <div className="container-teams">
                    <header className='header'>
                        <h2 className='logo'>Sportify</h2>
                        <div className='nav'>
                            <ul>
                                <li onClick={handleClickTeams
                                }>Teams</li>
                                <li onClick={handleClickMatches}>Matches</li>
                                <li onClick={handleClickTables}>Tables</li>
                            </ul>
                        </div>
                        {isAdmin && (
                            <button class="button-4" role="button" onClick={handleLogout}>Logout</button>
                        )}
                    </header>
                    <div class="form">
                        <div class="title">Welcome</div>
                        <div class="subtitle">Let's create your account!</div>
                        <div class="input-container ic1">
                            <input id="firstname" class="input" type="text" placeholder=" " />
                            <div class="cut"></div>
                            <label for="firstname" class="placeholder">First name</label>
                        </div>
                        <div class="input-container ic2">
                            <input id="lastname" class="input" type="text" placeholder=" " />

                            <div class="cut"></div>
                            <label for="lastname" class="placeholder">Last name</label>
                        </div>
                        <div class="input-container ic2">
                            <input id="email" class="input" type="text" placeholder=" " />
                            <div class="cut cut-short"></div>
                            <label for="email" class="placeholder">Email</label>
                        </div>
                        <button type="text" class="submit">submit</button>
                    </div>
                </div>
            </div>
        </>
    );
}
